const initialState = {
    dogs: [],
    allDogs: [],
    details: [],
    temperaments: []
}

function rootReducer (state = initialState, action){
    switch(action.type) {
        case 'GET_DOGS':
            return {
                ...state,
                dogs: action.payload,
                allDogs: action.payload
            }
        default:
            return state;
    }
}
